import React from "react";
import { BrowserRouter, Route, Link, Switch } from "react-router-dom";
import { render } from "react-dom";
import "./App.css";

function App() {
  return (
    <BrowserRouter>
      <div className='App'>
        <header className='App-header'>
          <p>Hola Bienvendidios!! Me llamo Carlos Adrian!</p>
        </header>
      </div>
    </BrowserRouter>
  );
}

export default App;
